import React from "react";
import { Image } from "react-native";
import { StyleSheet, Text, View } from "react-native";

export default function MoreComponent(){
    return(
        <View style={styles.container}>
            <Image style={styles.image} source={require('../../assets/foto1.png')}></Image>
            <Text style={{fontWeight: 'bold'}}>Parcele compras no app</Text>
            <Text style={{width: 210}}>Descontos em compras à vista no crédito, controle total sobre seu dinheiro</Text>
        </View>
    )
}

const styles = StyleSheet.create({    
    container:{
        width: 233
    },
    image:{
        width: 233,
        height: 90,
        borderTopLeftRadius: 15,
        borderTopRightRadius: 15,
    }
   
})
